import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, Typography } from '@mui/material';

const ProductList = ({ products, onDelete }) => {
  return (
    <Paper component="form" onSubmit={handleSubmit} style={formStyle}>
      <Typography variant="h4" component="h2" style={headerStyle}>
        Add Product
      </Typography>
      <Box style={formGroupStyle}>
        <TextField
          label="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          style={inputStyle}
          variant="outlined"
          fullWidth
          required
        />
      </Box>
      <Box style={formGroupStyle}>
        <TextField
          label="Image URL"
          value={imageUrl}
          onChange={(e) => setImageUrl(e.target.value)}
          style={inputStyle}
          variant="outlined"
          fullWidth
          required
        />
      </Box>
      <Button type="submit" variant="contained" color="primary" style={buttonStyle}>
        Add Product
      </Button>
    </Paper>
  );
};

export default ProductList;
